import React from "react";
import { Button, Checkbox, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle, FormControl, FormControlLabel, Input, InputAdornment, Paper, Radio, RadioGroup, Slide, TextField, Typography } from "@mui/material"
import style from './SolicitaServico.module.scss';
import { Box } from "@mui/system";
import axios from "axios";

const Transition = React.forwardRef(function Transition(props, ref) {
    return <Slide direction="up" ref={ref} {...props} />;
  });

export const SolicitaServico = ({ user, veiculo, setCadastroServico }) => {

    const service = [
        {
            id: 0,
            label: '2ª via do CRV'
        }, {
            id: 1,
            label: 'Impressão do CRLVe'
        }, {
            id: 2,
            label: 'Emissão de Certidão'
        }, {
            id: 3,
            label: 'Cópia de documentos'
        }, {
            id: 4,
            label: 'Licença Especial de Trânsito'
        }, {
            id: 5,
            label: 'Alteração de Informações do Proprietário'
        }, {
            id: 6,
            label: 'Alteração de Informações do Veículo'
        }, {
            id: 7,
            label: 'Inclusão de Restrição Financeira'
        }, {
            id: 8,
            label: 'Alteração de Restrição Financeira'
        }, {
            id: 9,
            label: 'Liberação de Restrição Financeira'
        }, {
            id: 10,
            label: 'Inclusão de Averbação de Execução'
        }, {
            id: 11,
            label: 'Liberação de Averbação de Execução'
        }, {
            id: 12,
            label: 'Restrição por Transferência'
        }, {
            id: 13,
            label: 'Inclusão Placa de Experiência ou de Fabricante'
        }, {
            id: 14,
            label: 'Renovação de Placa de Experiência ou de Fabricante'
        }, {
            id: 15,
            label: 'Baixa de Placa de Experiência ou de Fabricante'
        }, {
            id: 16,
            label: 'Baixa para outra UF'
        }, {
            id: 17,
            label: 'Baixa simples de Veículo'
        }, {
            id: 18,
            label: 'Baixa para militarização'
        }, {
            id: 19,
            label: 'Baixa para outro país'
        }, {
            id: 20,
            label: 'Cancelamento de Processo'
        }, {
            id: 21,
            label: 'Comunicação de Venda'
        }, {
            id: 22,
            label: 'Correção das Observações do CRLV-e'
        }, {
            id: 23,
            label: 'Correção do Chassi'
        }, {
            id: 24,
            label: 'Correção de Informações do Proprietário'
        }, {
            id: 25,
            label: 'Correção de Infomrações do Veículo'
        }, {
            id: 26,
            label: 'Correção de Município'
        }, {
            id: 27,
            label: 'Correção de Restrições'
        }, {
            id: 28,
            label: 'Mudança p/ Placa Única / Troca de Placa Mercosul'
        }, {
            id: 29,
            label: 'Primeiro Emplacamento'
        }, {
            id: 30,
            label: 'Reserva de Placa'
        }, {
            id: 31,
            label: 'Autorização para Fabricação de Placas'
        }, {
            id: 32,
            label: 'Colocação de lacre em placa'
        }, {
            id: 33,
            label: 'Autorização Para alteração de Características'
        }, {
            id: 34,
            label: 'Autorização para Regravação de Nº de Chassi'
        }, {
            id: 35,
            label: 'Autorização para Regravação de Nº de Motor'
        }, {
            id: 36,
            label: 'Autorização para Transporte Escolar'
        }, {
            id: 37,
            label: 'Solicitação de Vistoria'
        }, {
            id: 38,
            label: 'Transferência de Município de Veículo de Outra UF'
        }, {
            id: 39,
            label: 'Transferência de Município de Veículo do RS'
        }, {
            id: 40,
            label: 'Troca de Município de Veículo de Outra UF'
        }, {
            id: 41,
            label: 'Troca de Município de Veículo do RS'
        }
    ];

    const outros = {
        id: 42,
        label: 'Outros'
    };

    const finan1 = [
        {
            id: 0,
            label: 'Arrendamento',
        }, {
            id: 1,
            label: 'Penhor'
        }
    ];

    const finan2 = [
        {
            id: 2,
            label: 'Reserva de Domínio'
        }, {
            id: 3,
            label: 'Comodato',
        }, {
            id: 4,
            label: 'Pessoa Física'
        }
    ];

    const finan3 = [
        {
            id: 5,
            label: 'Alienação Fiduciária',
        }, {
            id: 6,
            label: 'Locação',
        }, {
            id: 7,
            label: 'Pessoa Jurídica'
        }
    ];

    const dialogo = [
        {
            id: 0,
            nome: `Erro campo Outros`,
            titulo: `Campo "Outros" deve ser preenchido!`,
            conteudo: `Ao escolher a opção "Outros" em servico, deve ser digitado manualmente o serviço desejado. Lembrando que deve-se escolher a opção "Outros" apenas quando a opção pretendida não esteja entre as disponíveis`
        },{
            id: 1,
            nome: `Erro Restrição Financeira `,
            titulo: `Selecione uma "Restrição Financeira" se houver!`,
            conteudo: `Ao selecionar "Sim" em "Haverá inclusão ou alteração de restricção financeira" deve-se selecionar um dos item abaixo!.`
        },{
            id: 2,
            nome: 'Erro Agente Financeiro',
            titulo: `Digite o "Agente Financeiro"`,
            conteudo: `Ao selecionar uma "Restrição Financeira" deve-se digitar o "Credor" e o "Agente Finacnerio" ligados a restrição.`
        },{
            id: 3,
            nome: 'Erro Município',
            titulo: `Campo "Município" vazio`,
            conteudo: `O formulario por se tratar de um documento deve-ser possuir o campo "Município" de origem deviamente preenchido`
        },{
            id: 4,
            nome: 'Erro Dia',
            titulo: `Campo "Dia" vazio`,
            conteudo: `O formulario por se tratar de um documento deve-ser possuir o campo "Dia" deviamente preenchido não podendo ficar em branco ou vazio`
        },{
            id: 5,
            nome: 'Erro Outros',
            titulo: `Campo "Mes" vazio`,
            conteudo: `O formulario por se tratar de um documento deve-ser possuir o campo "Mês" deviamente preenchido não podendo ficar em branco ou vazio`
        },{
            id: 6,
            nome: 'Erro campo Outros',
            titulo: `Campo "Ano" vazio`,
            conteudo: `O formulario por se tratar de um documento deve-ser possuir o campo "Ano" deviamente preenchido não podendo ficar em branco ou vazio`
        },{
            id: 7,
            nome: 'Erro campo Telefone',
            titulo: `Campo "Telefone" vazio`,
            conteudo: `O formulario por se tratar de um documento deve-ser possuir o campo "Telefone" deviamente preenchido não podendo ficar em branco ou vazio`
        },{
            id: 8,
            nome: 'Erro campo Email',
            titulo: `Campo "Email" vazio`,
            conteudo: `O formulario por se tratar de um documento deve-ser possuir o campo "Email" deviamente preenchido não podendo ficar em branco ou vazio`
        },{
            id: 9,
            nome: 'Erro Email',
            titulo: `"Email" inválido`,
            conteudo: `O "Email" cadastrado é invalido. Por gentileza, informa um "Email" válido para proseguir`
        }
    ];


    const verificaAverdade = {
        verdade: true,
        falsidade: false
    }

    const FinanSelect = (e) => {
        e.target.value === 'sim' ?
            setServico(a => ({ ...a, restricaoFinanceira: e.target.value })) :
            setServico(a => ({ ...a, restricaoFinanceira: e.target.value, restricao: '' }))
    }

    const SelecionaFinanceiro = (e) => {
        setServico(a => ({ ...a, restricao: e.target.value }))
    }

    const MotivoPlaca = (e) => {
        setServico(a => ({ ...a, servicoPlaca: e.target.value }))
    }

    const MotivoLacre = (e) => {
        setServico(a => ({ ...a, servicoLacre: e.target.value }))
    }

    const SelecionaEndereco = (e) => {
        setServico(a => ({ ...a, utilizarEndereco: e.target.checked === true ? 'sim' : 'nao' }))
    }

    const AlteraEndereco = (e) => {
        setServico(a => ({ ...a, alteraEndereco: e.target.value }))
    }

    const AutorizaEnvio = (e) => {
        setServico(a => ({ ...a, autorizacao: e.target.checked === true ? 'sim' : 'nao' }))
    }


    const SelecionaServico = (e) => {
        setServico(a => ({ ...a, servico: e.target.value, servicoLacre: '', servicoPlaca: '' }))
    };

    const CadastrarTelefone = (e) => {
        const numero = e.target.value.replace(/[^0-9]/g,'');
        console.log(numero)
        setServico(a => ({ ...a, telefoneProprietario: numero }))
    }

    const validarEmail = (e) => {
        servico.emailProprietario === '' ? setValidaemail(true) : setValidaemail(servico.emailProprietario.includes("@"));
    }

    const [servico, setServico] = React.useState({
        nome: user.nome,
        rg: user.rg,
        cpf: user.cpf,
        telefone: user.tel,
        placa: veiculo.placa,
        chassi: veiculo.chassi,
        servico: '',
        servicoPlaca: '',
        servicoLacre: '',
        servicoOutros: '',
        restricaoFinanceira: 'nao',
        restricao: '',
        credor: '',
        agente: '',
        utilizarEndereco: '',
        alteraEndereco: '',
        telefoneProprietario: '',
        emailProprietario: '',
        autorizacao: '',
        municipio: '',
        dia: Intl.DateTimeFormat('pt-BR', { day: "numeric" }).format(new Date()),
        mes: Intl.DateTimeFormat('pt-BR', { month: "long" }).format(new Date()),
        ano: Intl.DateTimeFormat('pt-BR', { year: '2-digit' }).format(new Date())
    })

    const [validaemail, setValidaemail] = React.useState(true);

    const [ dialog, setDialog ] = React.useState()

    const [ open, setOpen ] = React.useState(false);

    const look = servico.restricaoFinanceira === 'nao' ? verificaAverdade.verdade : verificaAverdade.falsidade

    const handleClose = () => {
        setOpen(false);
      };

    const SolServico = (e) => {
        e.preventDefault();

        if ((servico.servico === 'Outros') && (servico.servicoOutros === '')) {
            setOpen(true);
            setDialog(dialogo[0])
            console.log('opcao 1')
        } else if ((servico.restricaoFinanceira === 'sim') && (servico.restricao === '')) {
            if (servico.credor === '') {
                setOpen(true);
                setDialog(dialogo[1])
                console.log('opcao 2')
            } else if (servico.agente === '') {
                setOpen(true);
                setDialog(dialogo[2])
                console.log('opcao 3')
            } else {}
        } else if (servico.telefoneProprietario === '') {
            setOpen(true);
            setDialog(dialogo[7])
            console.log('opcao 8')
        } else if (servico.emailProprietario === '') {
            setOpen(true);
            setDialog(dialogo[8])
            console.log('opcao 9')
        } else if (servico.municipio === "") {
            setOpen(true);
            setDialog(dialogo[3])
            console.log('opcao 4')
        } else if (servico.dia === '') {
            setOpen(true);
            setDialog(dialogo[4])
            console.log('opcao 5')
        } else if (servico.mes === '') {
            setOpen(true);
            setDialog(dialogo[5])
            console.log('opcao 6')
        } else if (servico.ano === '') {
            setOpen(true);
            setDialog(dialogo[6])
            console.log('opcao 7')
        } else if (validaemail === false) {
            setOpen(true);
            setDialog(dialogo[9])
            console.log('opcao 10')
        } else {
            setCadastroServico(true)
            console.log('opcao Foi')
            // axios.post("http://localhost:3001")
        }

        console.log(servico)
    }
    if (validaemail === false) {
        return document.getElementById('aviso').innerHTML = ("Email invalido favor tentar um email valido!")
    } else if (validalogin === false) {
        return document.getElementById('aviso').innerHTML = ("Login já utilizado, favor tentar outro.")

    }


    return (
        <>
            <Dialog
                open={open}
                TransitionComponent={Transition}
                keepMounted
                onClose={handleClose}
                aria-describedby="alert-dialog-slide-description"
            >
                <DialogTitle>{dialog && dialog.titulo}</DialogTitle>
                <DialogContent>
                    <DialogContentText id="alert-dialog-slide-description">
                        {dialog && dialog.conteudo}
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose}>Fechar</Button>
                </DialogActions>
            </Dialog>
            <Typography variant='h6'>Selecione o serviço desejado</Typography>
            <div className={style.opcoes}>
                <Box sx={{ width: '100%' }}>
                    <Paper sx={{ p: 2 }}>
                        <Box sx={{ width: '100%' }}>
                            <div className={style.identificacao}>
                                <Typography variant='h6'>Eu, </Typography>
                                <div className={style.nome}>
                                    <FormControl fullWidth variant="standard">
                                        <Input
                                            id="standard-adornment-amount"
                                            value={user.nome}
                                            sx={{ width: '65vw' }}
                                            startAdornment={<InputAdornment position="start"></InputAdornment>}
                                        />
                                    </FormControl>
                                </div>
                                <Typography variant='h6' noWrap={true}>, Identidade</Typography>
                            </div>
                            <div className={style.identificacao}>
                                <Typography variant='h6'>nº</Typography>
                                <div className={style.rg}>
                                    <FormControl fullWidth variant="standard">
                                        <Input
                                            id="standard-adornment-amount"
                                            value={user.rg}
                                            sx={{ width: '30vw' }}
                                            startAdornment={<InputAdornment position="start"></InputAdornment>}
                                        />
                                    </FormControl>
                                </div>
                                <Typography variant='h6' noWrap={true}>, CPF nº</Typography>
                                <div className={style.cpf}>
                                    <FormControl fullWidth variant="standard">
                                        <Input
                                            id="standard-adornment-amount"
                                            value={user.cpf}
                                            sx={{ width: '30vw' }}
                                            startAdornment={<InputAdornment position="start"></InputAdornment>}
                                        />
                                    </FormControl>
                                </div>
                                <Typography variant='h6' noWrap={true}>, Telefone</Typography>
                            </div>
                            <div className={style.identificacao}>
                                <Typography variant='h6'>nº</Typography>
                                <div className={style.telefone}>
                                    <FormControl fullWidth variant="standard">
                                        <Input
                                            id="standard-adornment-amount"
                                            value={user.tel}
                                            sx={{ width: '35vw' }}
                                            startAdornment={<InputAdornment position="start"></InputAdornment>}
                                        />
                                    </FormControl>
                                </div>
                                <Typography variant='h6' noWrap={true}>, requeiro ao DETRAN/RS a realização do seguinte serviço,</Typography>
                            </div>
                            <div className={style.identificacao}>
                                <Typography variant='h6' noWrap={true} >Relato ao(s) veículos(s) placa(s)</Typography>
                                <div className={style.placa}>
                                    <FormControl fullWidth variant="standard">
                                        <Input
                                            id="standard-adornment-amount"
                                            value={veiculo.placa}
                                            sx={{ width: '23vw' }}
                                            startAdornment={<InputAdornment position="start"></InputAdornment>}
                                        />
                                    </FormControl>
                                </div>
                                <Typography variant='h6' noWrap={true} >, chassi(s)</Typography>
                                <div className={style.chassi}>
                                    <FormControl fullWidth variant="standard">
                                        <Input
                                            id="standard-adornment-amount"
                                            value={veiculo.chassi}
                                            sx={{ width: '23vw' }}
                                            startAdornment={<InputAdornment position="start"></InputAdornment>}
                                        />
                                    </FormControl>
                                </div>
                                <Typography variant='h6'>:</Typography>
                            </div>
                        </Box> <br />
                        <form onSubmit={SolServico}>
                            <Box sx={{ width: '100%' }}>
                                <div className={style.selecionaServico}>
                                    <div>
                                        <RadioGroup
                                            defaultValue=""
                                            name="select-service"
                                            value={servico.servico}
                                            onChange={SelecionaServico}
                                        >
                                            {[...Array(22)].map((iten, i) => (
                                                <FormControlLabel key={i + 1} value={service[i].label} control={<Radio size="small" />} label={service[i].label} />
                                            ))}
                                        </RadioGroup>
                                    </div>
                                    <div>
                                        <RadioGroup
                                            defaultValue=""
                                            name="select-service"
                                            value={servico.servico}
                                            onChange={SelecionaServico}
                                        >
                                            {service.map((iten, i) => i > 22 && (
                                                <>
                                                    <FormControlLabel key={i + 1} value={service[i].label} control={<Radio size='small' />} label={service[i].label} />
                                                    {service[i].id === 31 &&
                                                        <RadioGroup
                                                            defaultValue=""
                                                            name="select-service"
                                                            value={servico.servicoPlaca}
                                                            onChange={MotivoPlaca}
                                                        >
                                                            <div className={style.opcional}>
                                                                <FormControlLabel value='Furto/Roubo' control={<Radio size="small" />} label='furto/roubo' disabled={servico.servico === 'Autorização para Fabricação de Placas' ? false : true} />
                                                                <FormControlLabel value='Perda/Extravio' control={<Radio size="small" />} label='perda/extravio' disabled={servico.servico === 'Autorização para Fabricação de Placas' ? false : true} />
                                                                <FormControlLabel value='Outros' control={<Radio size="small" />} label='outros' disabled={servico.servico === 'Autorização para Fabricação de Placas' ? false : true} />
                                                            </div>
                                                        </RadioGroup>
                                                    }
                                                    {service[i].id === 32 &&
                                                        <RadioGroup
                                                            defaultValue=""
                                                            name="select-service"
                                                            value={servico.servicoLacre}
                                                            onChange={MotivoLacre}
                                                        >
                                                            <div className={style.opcional}>
                                                                <FormControlLabel value='Furto/Roubo' control={<Radio size="small" />} label='furto/roubo' disabled={servico.servico === 'Colocação de lacre em placa' ? false : true} />
                                                                <FormControlLabel value='Perda/Extravio' control={<Radio size="small" />} label='perda/extravio' disabled={servico.servico === 'Colocação de lacre em placa' ? false : true} />
                                                                <FormControlLabel value='Outros' control={<Radio size="small" />} label='outros' disabled={servico.servico === 'Colocação de lacre em placa' ? false : true} />
                                                            </div>
                                                        </RadioGroup>
                                                    }
                                                </>
                                            ))}
                                        </RadioGroup>
                                    </div>
                                </div>
                                <div className={style.outro}>
                                    <RadioGroup
                                        defaultValue=""
                                        name="select-service"
                                        value={servico.servico}
                                        onChange={SelecionaServico}
                                    >
                                        <FormControlLabel value={outros.label} control={<Radio size="small" />} label={outros.label} />
                                    </RadioGroup>
                                    <TextField variant="standard" size="small" disabled={servico.servico === 'Outros' ? false : true} fullWidth valeu={servico.servicoOutros} onChange={(e) => setServico(a => ({ ...a, servicoOutros: e.target.value }))} placeholder='Outros' />
                                </div>
                            </Box>
                            <Box sx={{ width: '100%' }}>
                                <div className={style.outro}>
                                    <Typography variant='h6'>Haverá inclusão ou alteração de restrição financeira? </Typography>
                                    <RadioGroup
                                        sx={{ ml: 2 }}
                                        defaultValue=""
                                        name="select-service"
                                        value={servico.restricaoFinanceira}
                                        onChange={FinanSelect}
                                    >
                                        <div className={style.outro}>
                                            <FormControlLabel value='sim' control={<Radio size="small" />} label={'Sim'} />
                                            <FormControlLabel value='nao' control={<Radio size="small" />} label={'Não'} />
                                        </div>
                                    </RadioGroup>
                                </div>
                                <div className={style.finan}>
                                    <div>
                                        <RadioGroup
                                            defaultValue=""
                                            name="select-service"
                                            value={servico.restricao}
                                            onChange={SelecionaFinanceiro}
                                        >
                                            {finan1.map((iten, i) => (
                                                <FormControlLabel key={iten.id} value={iten.label} control={<Radio size='small' />} label={iten.label} disabled={look} />
                                            ))}
                                        </RadioGroup>
                                        <div className={style.outro}>
                                            <Typography noWrap>O credor é: </Typography>
                                            <Input
                                                id='credor'
                                                disabled={look}
                                                sx={{ width: '15vw' }}
                                                startAdornment={[<InputAdornment position="start"></InputAdornment>, <InputAdornment position="start"></InputAdornment>]}
                                                value={servico.credor}
                                                onChange={(e) => setServico(a => ({ ...a, credor: e.target.value }))}
                                            />
                                        </div>
                                    </div>
                                    <div>
                                        <RadioGroup
                                            defaultValue=""
                                            name="select-service"
                                            value={servico.restricao}
                                            onChange={SelecionaFinanceiro}
                                        >
                                            {finan2.map((iten) => (
                                                <FormControlLabel key={iten.id} value={iten.label} control={<Radio size='small' />} label={iten.label} disabled={look} />
                                            ))}
                                        </RadioGroup>
                                    </div>
                                    <div>
                                        <RadioGroup
                                            defaultValue=""
                                            name="select-service"
                                            value={servico.restricao}
                                            onChange={SelecionaFinanceiro}
                                        >
                                            {finan3.map((iten) => (
                                                <FormControlLabel key={iten.id} value={iten.label} control={<Radio size='small' />} label={iten.label} disabled={look} />
                                            ))}
                                        </RadioGroup>
                                    </div>
                                </div>
                                <div className={style.financ}>
                                    <Typography noWrap>Agente Financeiro: </Typography>
                                    <Input
                                        id="standard-adornment-amount"
                                        disabled={look}
                                        value={servico.agente}
                                        sx={{ width: '65vw' }}
                                        startAdornment={<InputAdornment position="start"></InputAdornment>}
                                        onChange={(e) => setServico(a => ({ ...a, agente: e.target.value }))}
                                    />
                                </div>
                                <FormControlLabel
                                    defaultChecked={false}
                                    onChange={SelecionaEndereco}
                                    label='Utilizar o endereço da CNH emitida no RS'
                                    control={<Checkbox size="small" />}
                                />
                                <Typography>Houve alteração de endereço após o último licenciamento do veículo?</Typography>
                                <RadioGroup
                                    defaultValue=""
                                    name="select-service"
                                    value={servico.alteraEndereco}
                                    onChange={AlteraEndereco}
                                >
                                    <FormControlLabel value='nao' control={<Radio size="small" />} label='Não' />
                                    <FormControlLabel value='sim' control={<Radio size="small" />} label='Sim. Novo endereço, conforme comprovante de residência apresentado neste serviço:' />
                                </RadioGroup>
                                <br />
                                {/* <TextField variant="standard" size="small" disabled={look} fullWidth></TextField> */}
                                <div className={style.container1}>
                                    <div className={style.outro1}>
                                        <Typography noWrap >Telefone celular do Proprietário, adquirente, curador ou inventariante:</Typography>
                                        <TextField sx={{ width: '48%' }} value={servico.telefoneProprietario} onChange={CadastrarTelefone} variant="standard" placeholder="Telefone" size="small"></TextField>
                                    </div>
                                    <div className={style.outro1}>
                                        <Typography noWrap>Email do Proprietário, adquirente, curador ou inventariante:</Typography>
                                        <TextField sx={{ width: '55%' }} onChange={(e) => setServico(a => ({ ...a, emailProprietario: e.target.value }))} variant="standard" placeholder="Email" size="small"></TextField>
                                    </div>
                                    <FormControlLabel
                                        onChange={AutorizaEnvio}
                                        label='Autorizo o DETRAN/RS a enviar por email ou telefone celular informações de meu interesse junto a este órgão.'
                                        control={<Checkbox size="small" />}
                                    />
                                </div>
                                <div className={style.container2}>
                                    <Typography align="center" variant="h6">DECLARO, sob as penas da lei e sem prejuízo de demais sanções administrativas/cíveis/criminais, que</Typography>
                                    <Typography align="center" variant="h6">os documentos entregues ao DETRAN/RS para o serviço requerido são todos autênticos e, quando cópias,</Typography>
                                    <Typography align="center" variant="h6">condizem com o original e, caso haja produção de placa(s) de identificação veicular, que sou responsável</Typography>
                                    <Typography align="center" variant="h6">por assegurar a correta fixação da(s) placa(s) no veículo para o qual a estampagem foi autorizada, bem </Typography>
                                    <Typography align="center" variant="h6">como pela entrega das placas retiradas/substituídas na EPIV</Typography>
                                </div>
                                <div className={style.containerAssina}>
                                    <div className={style.assinatura1}>
                                        <Typography>Município:</Typography>
                                        <Input
                                            sx={{ width: '48%' }}
                                            id="standard-adornment-amount"
                                            onChange={(e) => setServico(a => ({ ...a, municipio: e.target.value }))}
                                            startAdornment={[<InputAdornment position="start"></InputAdornment>, <InputAdornment position="start"></InputAdornment>]}
                                        />
                                        <Typography>, </Typography>
                                        <Input
                                            sx={{ width: '7%' }}
                                            id="standard-adornment-amount"
                                            value={servico.dia}
                                            onChange={(e) => setServico(a => ({ ...a, dia: e.target.value }))}
                                            
                                            startAdornment={[<InputAdornment position="start"></InputAdornment>, <InputAdornment position="start"></InputAdornment>]}
                                        />
                                        <Typography> de </Typography>
                                        <Input
                                            sx={{ width: '20%' }}
                                            id="standard-adornment-amount"
                                            value={servico.mes}
                                            onChange={(e) => setServico(a => ({ ...a, mes: e.target.value }))}
                                            startAdornment={[<InputAdornment position="start"></InputAdornment>, <InputAdornment position="start"></InputAdornment>]}
                                        />
                                        <Typography noWrap> de 20 </Typography>
                                        <Input
                                            sx={{ width: '7%' }}
                                            id="standard-adornment-amount"
                                            value={servico.ano}
                                            onChange={(e) => setServico(a => ({ ...a, ano: e.target.value }))}
                                            startAdornment={[<InputAdornment position="start"></InputAdornment>, <InputAdornment position="start"></InputAdornment>]}
                                        />
                                        <Typography>.</Typography>
                                    </div>
                                    <div className={style.assinatura2}>
                                        <div className={style.linha}></div>
                                        <Typography>Assinatura do Responsável</Typography>
                                    </div>
                                </div>
                            </Box>
                            <Box>
                                <Button type='submit' >Enviar</Button>
                            </Box>
                        </form>
                    </Paper>
                </Box>
            </div>
        </>
    )
}
